snapshot.javascript:
var animnum;


global.when('start', function () {
  devices.get('lightanimationdisplay').play();
  devices.get('lightanimationdisplay').setXY(0,0);
  animnum = 0;
  time.every(1, 'frames', function () {
    devices.get('lightboard').onKeyDown('btn-B', function (){
      animnum += 1;
      if (animnum > 4) {
        animnum = 0;
      }
      if (animnum == 0) {
        devices.get('lightanimationdisplay').setAnimation('sun');
      }
      if (animnum == 1) {
        devices.get('lightanimationdisplay').setAnimation('wind');
      }
      if (animnum == 2) {
        devices.get('lightanimationdisplay').setAnimation('clouds');
      }
      if (animnum == 3) {
        devices.get('lightanimationdisplay').setAnimation('rainy');
      }

    });
  });
});

